import React,{Component} from 'react';
import {Link} from 'react-router-dom';
import Headroom from "react-headroom";
import '../assets/css/argon.css';
import '../assets/css/argon2.css.map';
import '../assets/css/argon3.min.css';

import {
  Button,
  UncontrolledCollapse,
  DropdownMenu,
  DropdownItem,
  DropdownToggle,
  UncontrolledDropdown,
  Media,
  NavbarBrand,
  Navbar,
  NavItem,
  NavLink,
  Nav,
  Container,
  Row,
  Col,
  UncontrolledTooltip
} from "reactstrap";

export default class Header extends Component{

  state = {
    collapseClasses: "",
    collapseOpen: false
  };

  onExiting = () => {
    this.setState({
      collapseClasses: "collapsing-out"
    });
  };

  onExited = () => {
    this.setState({
      collapseClasses: ""
    });
  };

  render(){
    return(
      <>
        <header className="header-global">
          <Headroom>
          <Navbar expand="lg">
            <Container>

              <button className="navbar-toggler" id="navbar_global">
                <span className="navbar-toggler-icon" />
              </button>
              <UncontrolledCollapse
                toggler="#navbar_global"
                navbar
                className='collapsing-out'>
                <Nav className="navbar-nav-hover" navbar>
                  <UncontrolledDropdown nav>
                    <DropdownToggle nav>
                      <i className="ni ni-collection d-lg-none mr-1" />
                      <span className="nav-link-inner--text">Opciones</span>
                    </DropdownToggle>
                    <DropdownMenu>
                      <DropdownItem to="/landing-page" tag={Link}>
                        Landing
                      </DropdownItem>
                      <DropdownItem to="/profile-page" tag={Link}>
                        Profile
                      </DropdownItem>
                      <DropdownItem to="/login-page" tag={Link}>
                        Login
                      </DropdownItem>
                      <DropdownItem to="/register-page" tag={Link}>
                        Register
                      </DropdownItem>
                    </DropdownMenu>
                  </UncontrolledDropdown>
                </Nav>
                </UncontrolledCollapse>
            </Container>
          </Navbar>
          </Headroom>
        </header>
        {/*<div>
          <nav>
            <ul>
              <li><Link to='/'>Home</Link></li>
              <li><Link to='/countries'>Paises</Link></li>
              <li><Link to='/departaments'>Departamentos</Link></li>
              <li><Link to='/add_departament'>Agregar Departamento</Link></li>
              <li><Link to='/add'>Agregar Pais</Link></li>
            </ul>
          </nav>
        </div>*/}
      </>

    );
  }
}
